import React, { Component } from "react";
import "./styles.scss";

class Home extends Component {
  render() {
    return (
      <table className="table">
        <thead>
          <tr>
            <th>STT</th>
            <th>Image</th>
            <th>Name Product</th>
            <th>Status</th>
            <th colSpan="2">Actions</th>
          </tr>
        </thead>
        <tbody>
          <td>1</td>
          <td>
            <img src="public\assets\image\gallery-1616062010.jpg" alt="" />
          </td>
          <td>AORUS</td>
          <td>
            <input type="checkbox" checked />
            <label htmlFor="">Stocking</label>
          </td>
          <td></td>
        </tbody>
      </table>
    );
  }
}

export default Home;
